import React from "react";
import 'react-native-gesture-handler';
import { StyleSheet, View, Text, TextInput, Button } from 'react-native';
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from '@react-navigation/stack';
import Login from '../screens/Login';
import Register from '../screens/Register';
import Categorías from '../screens/Categorías';
import Profile from '../screens/Profile';
import SettingScreen from '../screens/SettingScreen';
import ChangePassword from '../screens/idioma';
import idioma from '../screens/idioma';
import SeguridadScreen from '../screens/SeguridadScreen';

const Stack = createStackNavigator();

const App = () =>{
  return(
    <NavigationContainer>
    <Stack.Navigator initialRouteName="Login">
      <Stack.Screen name="Login" component={Login} />
      <Stack.Screen name="Registro" component={Register} />
      <Stack.Screen name="Categorías" component={Categorías} />
      <Stack.Screen name="Perfil" component={Profile} />
      <Stack.Screen name="Configuracion" component={SettingScreen} />
      <Stack.Screen
        name="Idioma"
        component={idioma}
      />
      <Stack.Screen name="CambiarTema" component={Tema} />
      <Stack.Screen name="CambiarIdioma" component={SeguridadScreen} />
    </Stack.Navigator>
  </NavigationContainer>
  )
}

export default App;
